import React from 'react';

// funcation component as not using life-cycle methods
function Album(props) {
    const { songs } = props;
    return (
        <ul>
            {songs && songs.map((song, index) => 
                <li key={index}>{song}</li>
            )}
        </ul>
    );
}

export default Album;
